//
import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia";

function App() {
	return (
		<div>
			<h1>
				<span>emojipedia</span>
			</h1>

			<dl className="dictionary">
				{/* <Entry */}
				{/* 	emoji="💪 " */}
				{/* 	ariaLabel="Tense Biceps" */}
				{/* 	description="“You can do that!” or “I feel strong!” Arm with tense biceps. Also	used in connection with doing sports, e.g. at the gym. " */}
				{/* /> */}
				{/* <Entry */}
				{/* 	emoji="🙏 " */}
				{/* 	ariaLabel="Person With Folded Hands." */}
				{/* 	description="Two hands pressed together. Is currently very introverted, saying a */}
				{/* 		prayer, or hoping for enlightenment. Is also used as a “high five” */}
				{/* 		or to say thank you." */}
				{/* /> */}
				{/* <Entry */}
				{/* 	emoji="💪 " */}
				{/* 	ariaLabel="Rolling On the Floor,  Laughing" */}
				{/* 	description="This is funny! A smiley face, rolling on the floor, laughing. The */}
				{/* 		face is laughing boundlessly. The emoji version of “rofl“. Stands */}
				{/* 		for rolling on the floor, laughing“." */}
				{/* /> */}
				emojipedia.map()
			</dl>
		</div>
	);
}

export default App;
